CREATE TABLE mytable(
   Department      VARCHAR(4) NOT NULL PRIMARY KEY
  ,CourseNumber    INTEGER  NOT NULL
  ,Section         VARCHAR(1)
  ,CourseName      VARCHAR(35) NOT NULL
  ,NumCredits      INTEGER  NOT NULL
  ,M               VARCHAR(1)
  ,T               VARCHAR(1)
  ,W               VARCHAR(1)
  ,R               VARCHAR(1)
  ,F               VARCHAR(1)
  ,StartTime       VARCHAR(8)
  ,EndTime         VARCHAR(8)
  ,InstructorLast  VARCHAR(15) NOT NULL
  ,InstructorFirst VARCHAR(11) NOT NULL
);
